import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <div className="nav">
      <div className="nav-contents">
        <img
          className="nav-logo"
          src="https://assets.fontsinuse.com/static/use-media-items/19/18221/full-800x371/5670304e/Netflix_Web_Logo.png "
          alt=""
        />
        <img
          className="nav-avatar"
          src="https://i.pinimg.com/originals/b4/0f/9f/b40f9f8fc0fb88aabf2a8acbc39c0ac0.png"
          alt=""
        />
      </div>
    </div>
  );
}

export default Nav;
